import React from "react";
// nodejs library to set properties for components
import PropTypes from "prop-types";
// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";

// @material-ui/icons

// core components
import GridContainer from "components/Grid/GridContainer.jsx";
import GridItem from "components/Grid/GridItem.jsx";
import Button from "components/CustomButtons/Button.jsx";


import NavPills from "components/NavPills/NavPills.jsx";
import FavoriteBorderOutlinedIcon from '@material-ui/icons/FavoriteBorderOutlined';
import LoyaltyOutlinedIcon from '@material-ui/icons/LoyaltyOutlined';

// react components for routing our app without refresh
import { Link } from "react-router-dom";

import {albumPersonStyle, navPillsStyle} from "assets/jss/material-kit-react/views/landingPageSections/albumPersonStyle";

class PersonSection extends React.Component {
  render() {
    const { classes } = this.props;
    return (
      <div className={classes.section}>
      <div className={classes.container}>
        <GridContainer className={classes.textCenter} justify="center">
          <GridItem xs={12} sm={12} md={8}>
            <h2 className={classes.title}>¿Sobre quién quieres trabajar hoy?</h2>

          </GridItem>
          <GridItem xs={12} sm={12} md={12}>
                <NavPills
                  color="rose"
                  horizontal={{
                    tabsGrid: { xs: 12, sm: 4, md: 4 },
                    contentGrid: { xs: 12, sm: 8, md: 8 }
                  }}
                  tabs={[
                    {
                      tabButton: "Familia",
                      tabIcon: FavoriteBorderOutlinedIcon,
                      tabContent: (
                        <span>

                        <Button
                        style={{display: "block", marginLeft: "400px"}}
                          color="success"
                          size="lg"
                        >
                          Papá
                        </Button>

                        </span>
                      )
                    },
                    {
                      tabButton: "Amigos",
                      tabIcon: LoyaltyOutlinedIcon,
                      tabContent: (
                        <span>

                        </span>
                      )
                    }
                  ]}
                />
              </GridItem>
        </GridContainer>
        </div>
        </div>
    );
  }
}

PersonSection.propTypes = {
  classes: PropTypes.object
};

export default withStyles(albumPersonStyle)(PersonSection);
